                    <option>Dog</option>
                    </select>
                </div>
            </div>
            <div className="col-md-3">
                <div className="form-group">
                <label htmlFor="price">room price ${price}</label>
                <input
                    type="range"
                    name="price"
                    min={minPrice}
                    max={maxPrice}
                    id="price"
                    value={price}
